sys_variable_value.value:
(function execute(inputs, outputs) {
  var grAtt = new GlideRecord('sys_attachment');
  if(grAtt.get(inputs.attachment)){

if(inputs.task)
{
  outputs.file_name = inputs.task.number + "_" + grAtt.file_name;
}else
{
  outputs.file_name = grAtt.file_name;
} 
  }
})(inputs, outputs);

